My Wife\'s Hot Friend - Zoe Holiday 

Actors: Zoe Holiday, Christian

Release Date: January 18, 2011

Zoe comes over to her friend Moxxie\'s house so they can go to a birthday party. Moxxie isn\'t home, but her husband Christian is and invites her up. He is busy relaxing on his day off with some Sudoku puzzles. She makes fun of him for being a nerd, and when she goes to leave, he makes his move. His wife is gone, he is bored, she is gorgeous, and he is going to prove to her that he isn\'t a nerd in the bedroom.
